import React from 'react'
import './App.css';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom';
import {DataCharacters} from './DataCharacters'
import {BtnStaff} from './Staff'

function App() {
  return (
    <>
    <Router>
      <Switch>
      <div>
      <Route path='/staff'>
        <BtnStaff />
        </Route>
      <Route exact path='/'>
        <DataCharacters />
      </Route>
      </div>
      </Switch>
      </Router>
    </>
  );
}

export default App;
